import React, { Fragment, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const AdminRegister = () => {

        const [formData, setFormData] = useState({
          name: '',
          email: '',
          password: '',
          password2: ''
        });

        const { name, email, password, password2 } = formData;
     const onChange = e => 
       setFormData({ ...formData, [e.target.name]: e.target.value });
        
       const onSubmit = async e => {
        e.preventDefault();
        if (password !== password2) {
        console.log('password do not match');
       } else {
        const newUser = {
            name,
            email,
            password
        }

        try {
            const config = {
                Headers: {
                    'content-type': 'application/json'
                }
            }

            const body = JSON.stringify(newUser);
           
           const res = await axios.post('/api/user', body, config);
           console.log(res.data);
          } catch(err) {
          console.error(err.response.data);
          }
       }
     };

  return (
    <section className="vh-100 bg-image" style={{ backgroundImage: "url('https://mdbcdn.b-cdn.net/img/Photos/new-templates/search-box/img4.webp')" }}>
      <div className="mask d-flex align-items-center h-100 gradient-custom-3">
        <div className="container h-100">
          <div className="row d-flex justify-content-center align-items-center h-100">
            <div className="col-12 col-md-9 col-lg-7 col-xl-6">
              <div className="card" style={{ borderRadius: '15px' }}>
                <div className="card-body p-5">
                  <h2 className="text-uppercase text-center mb-5">Create an account</h2>

                  <form className='form' onSubmit={onSubmit}>
                    <div className="form-outline mb-4">
                      <input type="text" id="form3Example1cg" className="form-control form-control-lg" name='name' value={name} onChange={onChange} />
                      <label className="form-label" htmlFor="form3Example1cg">Your Name</label>
                    </div>

                    <div className="form-outline mb-4">
                      <input type="email" id="form3Example3cg" className="form-control form-control-lg" name='email' value={email} onChange={onChange} />
                      <label className="form-label" htmlFor="form3Example3cg">Your Email</label>
                    </div>

                    <div className="form-outline mb-4">
                      <input type="password" id="form3Example4cg" className="form-control form-control-lg" name='password' value={password} onChange={onChange} />
                      <label className="form-label" htmlFor="form3Example4cg">Password</label>
                    </div>

                    <div className="form-outline mb-4">
                      <input type="password" id="form3Example4cdg" className="form-control form-control-lg" name='password2' value={password2} onChange={onChange} />
                      <label className="form-label" htmlFor="form3Example4cdg">Repeat your password</label>
                    </div>

                    <div className="form-check d-flex justify-content-center mb-5">
                      <input className="form-check-input me-2" type="checkbox" value="" id="form2Example3cg" />
                      <label className="form-check-label" htmlFor="form2Example3g">
                        I agree to all statements in <a href="#!" className="text-body"><u>Terms of service</u></a>
                      </label>
                    </div>

                    <div className="d-flex justify-content-center">
                      <button type="submit" className="btn btn-success btn-block btn-lg gradient-custom-4 text-body">Register</button>
                    </div>

                    <p className="text-center text-muted mt-5 mb-0">Already have an account? <a href="#!" className="fw-bold text-body"><u>Login here</u></a></p>
                  </form>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default AdminRegister;
